-- Creating the schema
create schema market_star_schema;

-- Using the schema
use market_star_schema;

-- Creating tables
CREATE TABLE `cust_dimen` (
  `Cust_id` varchar(12) NOT NULL,
  `Customer_Name` varchar(25) DEFAULT NULL,
  `City` varchar(12) DEFAULT NULL,
  `State` varchar(12) DEFAULT NULL,
  `Customer_Segment` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`Cust_id`)
);

CREATE TABLE `manu` (
  `Manu_Id` int(11) NOT NULL,
  `Manu_Name` varchar(30) DEFAULT NULL,
  `Manu_City` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`Manu_Id`)
);

CREATE TABLE `orders_dimen` (
  `Ord_id` varchar(12) NOT NULL,
  `Order_Number` int(11) NOT NULL,
  `Order_Date` date DEFAULT NULL,
  `Order_Priority` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`Ord_id`),
  KEY `Order_Number_index` (`Order_Number`)
);

CREATE TABLE `prod_dimen` (
  `Prod_id` varchar(12) NOT NULL,
  `Product_Category` varchar(25) DEFAULT NULL,
  `Product_Sub_Category` varchar(45) DEFAULT NULL,
  `Manu_Id` int(11) DEFAULT NULL,
  PRIMARY KEY (`Prod_id`)
);

CREATE TABLE `shipping_dimen` (
  `Ship_id` varchar(12) NOT NULL,
  `Order_ID` int(11) NOT NULL,
  `Ship_Mode` varchar(25) DEFAULT NULL,
  `Ship_Date` date DEFAULT NULL,
  PRIMARY KEY (`Ship_id`),
  KEY `Order_ID_index` (`Order_ID`)
);

CREATE TABLE `market_fact_full` (
  `Market_fact_id` int(11) NOT NULL,
  `Ord_id` varchar(12) DEFAULT NULL,
  `Prod_id` varchar(12) DEFAULT NULL,
  `Ship_id` varchar(12) DEFAULT NULL,
  `Cust_id` varchar(12) DEFAULT NULL,
  `Sales` decimal(65,30) DEFAULT NULL,
  `Discount` decimal(12,2) DEFAULT NULL,
  `Order_Quantity` int(11) NOT NULL,
  `Profit` decimal(12,2) DEFAULT NULL,
  `Shipping_Cost` decimal(12,2) DEFAULT NULL,
  `Product_Base_Margin` decimal(12,2) DEFAULT NULL,
  PRIMARY KEY (`Market_fact_id`),
  KEY `Order_Quantity_index` (`Order_Quantity`),
  KEY `Ship_Id_idx` (`Ship_id`),
  CONSTRAINT `Ship_Id` FOREIGN KEY (`Ship_id`) REFERENCES `shipping_dimen` (`Ship_id`)
);

